import React from 'react';
import {NavLink} from 'react-router-dom'

const Header = () => {
    return (
        <div>
            <NavLink to='/' >Главная</NavLink>
            <NavLink to='/new_words' >>Добавть слово</NavLink>
            <NavLink to='/new_words' >>Тренировка</NavLink>
            <NavLink to='/new_words' >>Авторизация</NavLink>
        </div>
    );
};

export default Header;
